import Graph from 'react-d3-graph';
// data structure definitions for NodeGraph component
export interface links {
	source: string;
	target: string;
}
export interface nodes {
	id: string;
}
export interface nodeGraphDataStruct {
	nodes: nodes[];
	links: links[];
}
export const myConfig = {
	nodeHighlightBehavior: true,
	node: {
		color: 'lightgreen',
		size: 120,
		highlightStrokeColor: 'blue',
	},
	link: {
		highlightColor: 'lightblue',
	},
};
export const onClickNode = function (nodeId) {
	window.alert(`${nodeId} is probably human?`);
};

export const onClickLink = function (source, target) {
	window.alert(`${source} is friends with ${target}`);
};
function NodeGraph({nodeGraphData}:{nodeGraphData:nodeGraphDataStruct}) {
    <Graph
		id="graph" // id is mandatory
		data={nodeGraphData}
		config={myConfig}
		onClickNode={onClickNode}
		onClickLink={onClickLink}
	/>
}
export default NodeGraph
